import React from 'react';
import styled from 'styled-components';

const Footer = () => {

    return (
        <FooterStyled><br></br> My Footer </FooterStyled>
    )
}
export default Footer;


const FooterStyled = styled.footer`

background-color: white;
padding: 20px;

`;
